style.css:
/* Change the color of normal hyperlinks */
a {
    color: 00008b !important; /* Change color to dark blue */
}

    /* Change the color of visited hyperlinks */
    a:visited {
        color: #d3d3d3 !important; /* Change color to light gray */
    }

    /* Change the color of hovered hyperlinks */
    a:hover {
        color: #0000FF !important; /* Change color to blue */
    }
